    [],nt"revision_timestamp": "2016-07-27T22:42:03.259913",nt"name": "evaluation-of-contaminant-residues-in-delaware-bay-bald-eagle-nestlings",nt"isopen":
    false,nt"url": null,nt"notes": "Bald eagle (Naliacetus leucocephalus) nesting
    attempts have steadily increased over the past decade in the Delaware Bay and River
    drainage basin; however, nesting success continues to be moderate. In this investigation,
    bald eagle nestling plasma, packed cells, and feathers were chemically analyzed
    to document baseline contaminant concentrations in the Delaware Bay population.
    Twelve plasma samples were analyzed for organochlorines. Geometric mean concentrations
    of DDD, DDE, and total PCBs were 11, 32, and 120 ppb wet weight, respectively. Eight
    packed cell samples were analyzed for inorganic contaminants, with mercury and selenium
    levels being the most notable results. Geometric mean concentrations were 606 and
    233 ppb wet weight, respectively. Analysis of twelve nestling breast feather samples
    resulted in geometric mean concentrations of mercury and selenium of 2.9 and 1.7
    ppm dry weight, respectively. A single addled egg was analyzed and contained significant
    adjusted wet weight concentrations of total PCBs (28.1 ppm), DDD (2.7 ppm), and
    DDE (13.9 ppm). Blood contaminant levels were generally lower than those reported
    for Maine (U.S. Fish and Wildlife Service, 1994a) and the Great Lakes breeding areas
    (Bowerman et al., 1994a), and were generally higher than those encountered in the
    Great Lakes inland breeding areas (Bowerman et al., 1994a) and the Pacific Northwest
    (Anthony et al., 1993). The blood analysis documented current nestling exposure
    to PBCs, DDE, and mercury, all of which may contribute to the low to moderate productivity
    observed in the Delaware Bay bald eagle population. Concentrations of DDD, DDE,
    and total PCBs in the addled egg may have contributed to the nest failure (Wiemeyer
    et al., 1993). Additional monitoring of nests and chemical analysis of recovered
    eggs, including congener specific PCBs, pesticides, and mercury, are recommended.
    The H4IIE bioassay procedure should also be performed on all eggs to elucidate potential
    toxicity of PCB congeners producing dioxin-like effects.",nt"license_title":
